import React from "react";
export default function Login(){

    return(
        <div className="login">
        <form>
            <h1>Sign In</h1>
            <div className="inputs">
                <label><input type="email" placeholder="Email"/></label>
                <label><input type="password" placeholder="Password"/></label>
            </div>
                <button onClick="">Sign In</button>
        </form>
        </div>
    )
}
